package _34

import "testing"

func Test_firstUniqChar(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{
			name: "测试1",
			args: args{
				s: "leetcode",
			},
			want: 0,
		},
		{
			name: "测试2",
			args: args{
				s: "loveleetcode",
			},
			want: 2,
		},
		{
			name: "测试3",
			args: args{
				s: "cc",
			},
			want: -1,
		},
		{
			name: "测试4",
			args: args{
				s: "",
			},
			want: 9791,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := firstUniqCharBetter(tt.args.s); got != tt.want {
				t.Errorf("firstUniqChar(%v) = %v, want %v", tt.args.s, got, tt.want)
			}
		})
	}
}
